import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@chainlink/contracts/src/v0.8/VRFConsumerBase.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/utils/cryptography/MerkleProof.sol";
import {IWETH} from "./interfaces/IWETH.sol";

contract RafflePolygon is Ownable, Pausable, ReentrancyGuard, VRFConsumerBase {
    using SafeERC20 for IERC20;

    enum RaffleState {
        IN_PROGRESS,
        FINISHED,
        COMPLETED,
        REFUNDED,
        CLAIMED
    }

    enum RaffleType {
        ERC721,
        ERC20
    }

    struct RaffleData {
        address assetContract;
        address raffleOwner;
        address raffleWinner;
        RaffleState raffleState;
        RaffleType raffleType;
        address currency;
        bytes32 MerkleRoot;
        uint128 nftIdOrAmount;
        uint128 pricePerTicket;
        uint64 endTimestamp;
        uint64 numberOfTickets;
        uint64 ticketsSold;
        uint64 minimumTicketsSold;
    }

    struct Order {
        address owner;
        address currency;
        uint128 price;
    }

    address public relayer;
    // ERC20 address => isWhitelisted?
    mapping(address => bool) public whitelistedCurrencies;
    // raffleID => RaffleData
    mapping(uint256 => RaffleData) public raffles;
    // raffleID => FairRaffleFee
    mapping(uint256 => uint256) public raffleToFairRaffleFee;
    // raffleID => ticketId => ticketOwner
    mapping(uint256 => mapping(uint256 => address)) public raffleTickets;
    // raffleId => ticketId => Order
    mapping(uint256 => mapping(uint256 => Order)) public ticketOrders;
    // ChainlinkRequest => raffleID
    mapping(bytes32 => uint256) private chainlinkRequestToRaffleID;

    // Number of raffles created so far
    uint256 public raffleCounter;

    // Chainlink related state variables
    bytes32 public immutable linkKeyHash;
    uint256 public immutable linkFee;

    // We can use IWETH interface as the contracts are identical
    IWETH private constant WMATIC = IWETH(0x0d500B1d8E8eF31E21C99d1Db9A6444d3ADf1270); // WMATIC address in Polygon

    // 2,5% Fee
    uint256 public FEE_NUMERATOR = 250;
    uint256 public FEE_DENOMINATOR = 10000;

    // 5% FAIR_RAFFLE_FEE
    uint256 public constant FAIR_RAFFLE_FEE_NUMERATOR = 500;
    uint256 public constant FAIR_RAFFLE_FEE_DENOMINATOR = 10000;

    /**
        Token address => Amount that owners of the contract can claim as fee rewards
        address(0) = Matic
     */
    mapping(address => uint256) public totalAmountClaimable;

    // The name of this contract
    string public constant name = "RafflePolygon";
    string public constant version = "1";
    // The EIP-712 typehash for the contract's domain
    bytes32 private constant DOMAIN_TYPEHASH = keccak256("EIP712Domain(string name,string version,uint256 chainId,address verifyingContract)");
    // The EIP-712 typehash for the ballot struct used by the contract
    bytes32 private constant BALLOT_TYPEHASH = keccak256("Ballot(address buyer,uint256 raffleId,uint256 ticketId,address currency,uint128 price,uint256 nonce)");
    mapping (address => uint256) public nonce;

    event MainnetCall(
        address receiver,
        address assetContract,
        bool isERC721,
        uint256 amountOrNftIdToReceiver,
        uint256 increaseTotalAmountClaimable
    );
    event NewRaffleCreated(uint256 raffleId);
    event RaffleCancelled(uint256 raffleId);
    event ERC20CurrencyAdded(address currency);
    event ERC20CurrencyRemoved(address currency);
    event RaffleStateChanged(
        uint256 raffleId, 
        RaffleState oldRaffleState, 
        RaffleState newRaffleState
    );
    event ChainlinkRequest(bytes32 requestId);
    event TicketSellOrderCreated(address seller, 
        uint256 raffleId, 
        uint256 ticketId, 
        address currency, 
        uint128 price
    );
    event TicketSellOrderCancelled(
        address seller, 
        uint256 raffleId, 
        uint256 ticketId, 
        address currency, 
        uint128 price
    );
    event NewRaffleTicketBought(
        uint256 raffleId, 
        address buyer, 
        uint64 numberOfTickets, 
        uint256 initTicketId, 
        uint256 endTicketId
    );
    event TicketBoughtFromMarket(
        address buyer, 
        address seller, 
        uint256 raffleId, 
        uint256 ticketId, 
        address currency, 
        uint128 price
    );
    event TicketBoughtFromMarketWithSignature(
        address buyer, 
        address seller, 
        uint256 raffleId, 
        uint256 ticketId, 
        address currency, 
        uint128 price
    );

    constructor(address _relayer, bytes32 _linkKeyHash, uint256 _linkFee, address _vrfCoordinator, address _vrfLinkTokenAddress) VRFConsumerBase(_vrfCoordinator, _vrfLinkTokenAddress) {
        relayer = _relayer;
        linkKeyHash = _linkKeyHash;
        linkFee = _linkFee;
        /** 
         * Matic is whitelisted here = address(0)
         * Although it is not enabled in the Mainnet contract, which means that no raffles will be bought with matic. 
         * Matic can only be used to purchase tickets, not to buy RaffleTickets directly
         */
        whitelistedCurrencies[address(0)] = true;
    }

    modifier onlyRelayer {
        require(msg.sender == relayer, "OnlyRelayer");
        _;
    }

    /**
     * @notice  Creates a raffle
     * @param   _raffleData Structure that contains all the data related to the Raffle
     * @param   _fairRaffleFee FairRaffleFee
     */
    function createRaffle(RaffleData memory _raffleData, uint256 _fairRaffleFee) external onlyRelayer whenNotPaused {
        raffleCounter += 1;
        // Validation is already done in the MainnetEscrow contract
        RaffleData storage raffleData = raffles[raffleCounter];
        raffleData.assetContract = _raffleData.assetContract;
        raffleData.raffleOwner = _raffleData.raffleOwner;
        raffleData.raffleState = RaffleState.IN_PROGRESS;
        raffleData.raffleType = _raffleData.raffleType;
        raffleData.nftIdOrAmount = _raffleData.nftIdOrAmount;
        raffleData.currency = _raffleData.currency;
        raffleData.pricePerTicket = _raffleData.pricePerTicket;
        raffleData.MerkleRoot = _raffleData.MerkleRoot;
        raffleData.endTimestamp = _raffleData.endTimestamp;
        raffleData.numberOfTickets = _raffleData.numberOfTickets;
        raffleData.minimumTicketsSold = _raffleData.minimumTicketsSold;
        raffleToFairRaffleFee[raffleCounter] = _fairRaffleFee;
        emit NewRaffleCreated(raffleCounter);
    }

    /**
        * @notice  Allows raffle owners to cancel a raffle if NO tickets were sold yet
        * @param   _raffleId The ID of the raffle
    */
    function cancelRaffle(uint256 _raffleId) external nonReentrant whenNotPaused{
        RaffleData memory raffleData = raffles[_raffleId];
        require(msg.sender == raffleData.raffleOwner, "You cannot cancel someone else's raffle");
        require(raffleData.raffleState == RaffleState.IN_PROGRESS, "This raffle has already ended");
        require(raffleData.ticketsSold < 1, "Tickets have already been bought");

        // Delete the object from storage
        delete raffles[_raffleId];
        // Set is as REFUNDED
        raffles[_raffleId].raffleState = RaffleState.REFUNDED;
        emit RaffleStateChanged(_raffleId, RaffleState.IN_PROGRESS, RaffleState.REFUNDED);

        // Check which type of asset 
        if (raffleData.raffleType == RaffleType.ERC721) {
            // Emit event to refund the raffle owner
            emit MainnetCall(
                raffleData.raffleOwner,
                raffleData.assetContract,
                true,
                raffleData.nftIdOrAmount,
                0
            );
            // Give back to the Raffle Owner the FAIR_RAFFLE_FEE paid
            emit MainnetCall(
                raffleData.raffleOwner,
                address(0),
                false,
                raffleToFairRaffleFee[_raffleId],
                0
            );
        } 
        else if (raffleData.raffleType == RaffleType.ERC20) {
            // Emit event to refund the raffle owner
            emit MainnetCall(
                raffleData.raffleOwner,
                raffleData.assetContract,
                false,
                raffleData.nftIdOrAmount,
                0
            );
        }
        emit RaffleCancelled(_raffleId);
    }

    /**
     * @notice  Allows users to buy tickets for a Raffle
     * @param   _raffleId The ID of the raffle the user wants to buy a ticket for
     * @param   _numberOfTickets The number of tickets an user wants to buy
     * @param   _merkleProof MerkleProof used to verify user is part of the whitelist (Used with Whitelisted Raffles only)
     */
    function buyRaffleTicket(uint256 _raffleId, uint64 _numberOfTickets, bytes32[] calldata _merkleProof) external whenNotPaused {
        RaffleData memory raffleData = raffles[_raffleId];
        require(raffleData.raffleOwner != address(0), "This raffle does not exist");
        require(block.timestamp < raffleData.endTimestamp, "This raffle has already ended");
        require(raffleData.raffleState == RaffleState.IN_PROGRESS, "This raffle has already ended");
        require(raffleData.ticketsSold < raffleData.numberOfTickets, "Tickets sold out");
        require(_numberOfTickets <= (raffleData.numberOfTickets - raffleData.ticketsSold), "There are not so many tickets available to buy");
        // If this is a whitelisted Raffle, we must verify the _merkleProof
        if (raffleData.MerkleRoot != bytes32(0)){
            bytes32 leaf = keccak256(abi.encodePacked(msg.sender));
            require(MerkleProof.verify(_merkleProof, raffleData.MerkleRoot, leaf), "User not whitelisted");
        }
        // Handle the payment
        IERC20(raffleData.currency).safeTransferFrom(msg.sender, address(this), _numberOfTickets * raffleData.pricePerTicket);
        // Assign the tickets to the buyer
        uint256 initTicketId = raffleData.ticketsSold;
        for (uint256 i; i < _numberOfTickets; ++i){
            raffleTickets[_raffleId][raffleData.ticketsSold + i] = msg.sender;
        }
        raffles[_raffleId].ticketsSold += _numberOfTickets;  
        emit NewRaffleTicketBought(_raffleId, msg.sender, _numberOfTickets, initTicketId, initTicketId + _numberOfTickets - 1);
    }

    /**
     * @notice  Allows users to complete a Raffle. The winner of the raffle will receive the asset.
                The owner of the raffle will receive his payment
                Cron job will call daily all the pending raffles. Users can also call it
     * @param   _raffleId The ID of the raffle the user wants to buy a ticket for
     */
    function completeRaffle(uint256 _raffleId) external whenNotPaused {
        RaffleData memory raffleData = raffles[_raffleId];
        require(raffleData.raffleOwner != address(0), "This raffle does not exist");
        require(raffleData.raffleState == RaffleState.IN_PROGRESS, "This raffle was already completed");
        if (raffleData.ticketsSold != raffleData.numberOfTickets){
            require(block.timestamp >= raffleData.endTimestamp, "Raffle is not completed");
        }
        // In this case we must refund all the ticket buyers
        if (raffleData.ticketsSold < raffleData.minimumTicketsSold){
            // Send the asset back to the raffleOwner
            if (raffleData.raffleType == RaffleType.ERC721){
                emit MainnetCall(
                    raffleData.raffleOwner,
                    raffleData.assetContract,
                    true,
                    raffleData.nftIdOrAmount,
                    0
                );
            }
            if (raffleData.raffleType == RaffleType.ERC20){
                emit MainnetCall(
                    raffleData.raffleOwner,
                    raffleData.assetContract,
                    true,
                    raffleData.nftIdOrAmount - raffleToFairRaffleFee[_raffleId],
                    raffleToFairRaffleFee[_raffleId] // Take ownership of the FAIR_RAFFLE_FEE paid by the Raffle Owner
                );
            }
            raffles[_raffleId].raffleState = RaffleState.REFUNDED;
            emit RaffleStateChanged(_raffleId, RaffleState.IN_PROGRESS, RaffleState.REFUNDED);
        }
        // Normal flow
        else {
            // This will mark the raffle State as FINISHED. Can only be called once.
            bytes32 request = _requestRandomness(_raffleId);
            emit ChainlinkRequest(request);
            chainlinkRequestToRaffleID[request] = _raffleId;
        }
    }

    /**
     * @notice  Allows users to claim the raffle. Owner of the raffle will receive the payment and the winner his asset
     * @param   _raffleId The ID of the raffle the user wants to buy a ticket for
     */
    function claimRaffle(uint256 _raffleId) external nonReentrant whenNotPaused {
        RaffleData storage raffleData = raffles[_raffleId];
        require(raffleData.raffleOwner != address(0), "This raffle does not exist");
        require(raffleData.raffleState == RaffleState.COMPLETED, "This raffle was already completed");

        raffleData.raffleState = RaffleState.CLAIMED;
        emit RaffleStateChanged(_raffleId, RaffleState.COMPLETED, RaffleState.CLAIMED);

        address raffleOwner = raffleData.raffleOwner;
        address winner = raffleData.raffleWinner;

        // Sending the asset to the winner
        if (raffleData.raffleType == RaffleType.ERC721){
            emit MainnetCall(
                winner,
                raffleData.assetContract,
                true,
                raffleData.nftIdOrAmount,
                0
            );
            // Give back to the Raffle Owner the FAIR_RAFFLE_FEE paid
            emit MainnetCall(
                raffleData.raffleOwner,
                address(0),
                false,
                raffleToFairRaffleFee[_raffleId],
                0
            );
        }
        if (raffleData.raffleType == RaffleType.ERC20){
            emit MainnetCall(
                winner,
                raffleData.assetContract,
                false,
                raffleData.nftIdOrAmount,
                0
            );
        }

        uint256 totalAmountEarned = raffleData.ticketsSold * raffleData.pricePerTicket;
        uint256 fee = (totalAmountEarned * FEE_NUMERATOR) / FEE_DENOMINATOR;
        totalAmountEarned -= fee;
        address raffleCurrency = raffleData.currency;
        totalAmountClaimable[raffleCurrency] += fee;

        // Payments to the raffle owner
        IERC20(raffleCurrency).safeTransfer(raffleOwner, totalAmountEarned);
    }

    /**
     * @notice  Allows users to claim a cancelled raffle where they will receive their initially payment
     * @param   _raffleId The ID of the raffle the user wants to buy a ticket for
     * @param   ticketIds Array of ticketIds to claim
     */
    function claimCancelledRaffle(uint256 _raffleId, uint256[] calldata ticketIds) external nonReentrant whenNotPaused{
        RaffleData memory raffleData = raffles[_raffleId];
        require(raffleData.raffleState == RaffleState.REFUNDED, "Raffle is not in REFUNDED state");
        uint256 len = ticketIds.length;
        for(uint i; i < len; ++i){
            require(raffleTickets[_raffleId][ticketIds[i]] == msg.sender, "You do not own this ticket Id");
            raffleTickets[_raffleId][ticketIds[i]] = address(0);
        }
        uint256 totalRefund = len * raffleData.pricePerTicket;
        IERC20(raffleData.currency).safeTransfer(msg.sender, totalRefund);
    }

    /** ############################################################################################
     *              TICKET MARKETPLACE FUNCTIONS
     *  ############################################################################################
     */

    /**
     * @notice  Allows users to put their raffle tickets for sale
     * @param   _raffleId raffleID
     * @param   _ticketId ticketID
     * @param   _currency Tickets will be bought with this ERC20 token. address(0) should be put here if the currency will be Matic
     * @param   _price Price per ticket. It can be zero in case of an "airdrop"
     */
    function postSellOrder(uint256 _raffleId, uint256 _ticketId, address _currency, uint128 _price) external whenNotPaused {
        require(msg.sender == raffleTickets[_raffleId][_ticketId], "You do not own this ticket");
        require(whitelistedCurrencies[_currency], "This currency is not whitelisted");
        require(raffles[_raffleId].raffleState == RaffleState.IN_PROGRESS, "This raffle has already ended");

        Order storage orderData = ticketOrders[_raffleId][_ticketId];
        orderData.owner = msg.sender;
        orderData.currency = _currency;
        orderData.price = _price;
        emit TicketSellOrderCreated(msg.sender, _raffleId, _ticketId, _currency, _price);
    }

    /**
     * @notice  Allows Order owners to cancel a current sell order
     * @param   _raffleId raffleID
     * @param   _ticketId ticketID
     */
    function cancelSellOrder(uint256 _raffleId, uint256 _ticketId) external whenNotPaused {
        Order memory orderData = ticketOrders[_raffleId][_ticketId];
        require(orderData.owner == msg.sender, "You do not own this order");

        delete ticketOrders[_raffleId][_ticketId];
        emit TicketSellOrderCancelled(msg.sender, _raffleId, _ticketId, orderData.currency, orderData.price);
    }

    /**
     * @notice  Allows users to buy a raffle ticket
     * @param   _raffleId raffleID
     * @param   _ticketId ticketID
     * @param   _buyer Address which the ticket will be assigned to
     * @param   _price Price paid in the buy order. It should be the same as the price of the current sell order,
     *          otherwise it will revert. Used to avoid a seller frontrunning a postBuyOrder() call with a
     *          postSellOrder() call increasing the price
     */
    function postBuyOrder(uint256 _raffleId, uint256 _ticketId, address _buyer, uint256 _price) external payable nonReentrant whenNotPaused {
        Order memory orderData = ticketOrders[_raffleId][_ticketId];
        require(orderData.owner != address(0), "This order does not exist");
        require(orderData.owner == raffleTickets[_raffleId][_ticketId], "Ticket has a new owner");
        require(whitelistedCurrencies[orderData.currency], "Currency is not whitelisted");
        require(raffles[_raffleId].raffleState == RaffleState.IN_PROGRESS, "Raffle state must be IN_PROGRESS");

        uint256 fee = (orderData.price * FEE_NUMERATOR) / FEE_DENOMINATOR;
        uint256 payment = orderData.price - fee;
        // Payment in Matic
        if(orderData.currency == address(0)){
            _price = msg.value;
            require(_price == orderData.price, "Matic payment too low");
            _handleNativeTransfer(orderData.owner, payment);
            totalAmountClaimable[address(0)] += fee;
        }
        else{
            require(_price == orderData.price, "Wrong price set");
            IERC20(orderData.currency).safeTransferFrom(msg.sender, address(this), fee);
            IERC20(orderData.currency).safeTransferFrom(msg.sender, orderData.owner, payment);
            totalAmountClaimable[orderData.currency] += fee;
        }

        delete ticketOrders[_raffleId][_ticketId];
        raffleTickets[_raffleId][_ticketId] = _buyer;

        emit TicketBoughtFromMarket(_buyer, orderData.owner, _raffleId, _ticketId, orderData.currency, orderData.price);
    }

    /**
     * @notice  Allows users to buy a raffle ticket with a valid signature of the current NFT owner
     * @param   _raffleId rafleId
     * @param   _ticketId ticketId
     * @param   _currency ERC20 used as payment
     * @param   _price Price
     * @param   _buyer Address which the ticket will be assigned to
     * @param   _r Signature R
     * @param   _s Signature S
     * @param   _v Signature V
     */
    function buyTicketWithSignature(uint256 _raffleId, uint256 _ticketId, address _currency, uint128 _price, address _buyer, bytes32 _r, bytes32 _s, uint8 _v) external payable nonReentrant whenNotPaused {
        address seller = raffleTickets[_raffleId][_ticketId];
        require(seller != address(0), "This ticket does not exist");
        require(whitelistedCurrencies[_currency], "Currency is not whitelisted");
        require(raffles[_raffleId].raffleState == RaffleState.IN_PROGRESS, "Raffle state must be IN_PROGRESS");

        // Used to prevent stack too deep error
        {
            bytes32 domainSeparator = keccak256(abi.encode(DOMAIN_TYPEHASH, keccak256(bytes(name)), keccak256(bytes(version)), block.chainid, address(this)));
            bytes32 structHash = keccak256(abi.encode(BALLOT_TYPEHASH, msg.sender, _raffleId, _ticketId, _currency, _price, nonce[seller]));
            bytes32 digest = keccak256(abi.encodePacked("\x19\x01", domainSeparator, structHash));
            address signer = ecrecover(digest, _v, _r, _s);
            require(signer == seller, "Invalid signature");
        }
        nonce[seller] += 1;

        uint256 fee = (_price * FEE_NUMERATOR) / FEE_DENOMINATOR;
        uint256 payment = _price - fee;
        // Payment in Matic
        if(_currency == address(0)){
            require(msg.value == _price, "Matic payment too low");
            _handleNativeTransfer(seller, payment);
            totalAmountClaimable[address(0)] += fee;
        }
        else{
            IERC20(_currency).safeTransferFrom(msg.sender, address(this), fee);
            IERC20(_currency).safeTransferFrom(msg.sender, seller, payment);
            totalAmountClaimable[_currency] += fee;
        }

        raffleTickets[_raffleId][_ticketId] = _buyer;
        delete ticketOrders[_raffleId][_ticketId];
        emit TicketBoughtFromMarketWithSignature(_buyer, seller, _raffleId, _ticketId, _currency, _price);
    }

    /** ############################################################################################
     *              INTERNAL/PRIVATE FUNCTIONS
     *  ############################################################################################
     */

    function _requestRandomness(uint256 _raffleId) internal returns (bytes32 requestId) {
        require(LINK.balanceOf(address(this)) >= linkFee, "Not enough LINK");
        RaffleData storage raffleData = raffles[_raffleId];
        raffleData.raffleState = RaffleState.FINISHED;
        emit RaffleStateChanged(_raffleId, RaffleState.IN_PROGRESS, RaffleState.FINISHED);
        requestId = requestRandomness(linkKeyHash, linkFee);
    }

    function fulfillRandomness(bytes32 requestId, uint256 randomness) internal override {
        uint256 raffleId = chainlinkRequestToRaffleID[requestId];
        RaffleData storage raffleData = raffles[raffleId];
        raffleData.raffleState = RaffleState.COMPLETED;
        emit RaffleStateChanged(raffleId, RaffleState.FINISHED, RaffleState.COMPLETED);
        // Picking up the winner
        uint256 winningIndex = randomness % raffleData.ticketsSold;
        raffleData.raffleWinner = raffleTickets[raffleId][winningIndex];
    }

