    function fulfillRandomnessTest(bytes32 requestId, uint256 randomness) external {
        fulfillRandomness(requestId, randomness);
    }

    /**
     *  Function to handle native transfers
     */
    function _handleNativeTransfer(address _dest, uint256 _amount) internal {
        // Handle MATIC payment
        require(address(this).balance >= _amount, "_handleNativeTransfer insolvent");
        uint256 gas =  gasleft();
        (bool success, ) = _dest.call{value: _amount, gas: gas}("");
        // If the MATIC transfer fails, wrap the MATIC and try to send it as WMATIC.
        if (!success) {
            WMATIC.deposit{value: _amount}();
            IERC20(address(WMATIC)).safeTransfer(_dest, _amount);
        }
    }

