    function setRelayer(address _newRelayer) external onlyOwner {
        relayer = _newRelayer;
    }

    /**
     * @notice  Used to pause/unpause the smart contract by the owner
     */
    function togglePause() external onlyOwner {
        if (!paused()) _pause();
        else _unpause();
    }

    /**
     * @notice  Used to whitelist/blacklist an ERC20 token to be used as a payment currency
     */
    function toggleCurrency(address _ERC20TokenAddress) external onlyOwner {
        if (whitelistedCurrencies[_ERC20TokenAddress]){
            whitelistedCurrencies[_ERC20TokenAddress] = false;
            emit ERC20CurrencyRemoved(_ERC20TokenAddress);
        }
        else{
            whitelistedCurrencies[_ERC20TokenAddress] = true;
            emit ERC20CurrencyAdded(_ERC20TokenAddress);
        }
    }

    /**
     * @notice  Used by the contract owners to claim the fees accrued
     * @param   _tokenAddress List of tokens to withdraw the fees
     * @param   _amounts List of amounts that will be withdrawn
     * @param   _receiver Address that will receive the fees
     */
    function withdrawFees(address[] calldata _tokenAddress, uint256[] calldata _amounts, address _receiver) external onlyOwner {
        uint256 len = _tokenAddress.length;
        require(len == _amounts.length, "Array lengths do not match");
        uint256 amount;
        address tokenAddress;
        for (uint256 i; i < len; ++i) {
            tokenAddress = _tokenAddress[i];
            amount = _amounts[i];
            require(amount <= totalAmountClaimable[tokenAddress], "Amount too high");
            if(tokenAddress == address(0)){
                _handleNativeTransfer(_receiver, amount);
            }
            else{
                IERC20(tokenAddress).safeTransfer(_receiver, amount);
            }
            // No overflow here as => require(amount <= totalAmountClaimable[tokenAddress])
            unchecked {
                totalAmountClaimable[tokenAddress] -= amount;
            }
        }
    }

