    function getRaffleDetails(uint256 _raffleId) external view returns(RaffleData memory) {
        require(_raffleId <= raffleCounter, "The raffle ID does not exist");
        return(raffles[_raffleId]);
    }

    function getRaffleState(uint256 _raffleId) external view returns(RaffleState) {
        require(_raffleId <= raffleCounter, "The raffle ID does not exist");
        return(raffles[_raffleId].raffleState);
    }

    function getRaffleTicketOwner(uint256 _raffleId, uint256 _ticketId) external view returns(address) {
        address ticketOwner = raffleTickets[_raffleId][_ticketId];
        require(ticketOwner != address(0), "Ticket does not exist");
        return ticketOwner;
    }

    function isCurrencyWhitelisted(address _erc20Token) external view returns(bool) {
        return whitelistedCurrencies[_erc20Token];
